%[text] #     Predicting True Air Speed from Other Sensors
%[text] This example shows how to use historical data to train a regression model that is capable of predicting the True Air Speed (TAS) of a flight from the measurements of other sensors. Such models can be useful in controls applications where it may be desirable to use a regression model as a nonlinear state estimator for a non-observable or costly-to-observe state.  These types of models can also be used as surrogate models in simulations and trade-studies, in cases where a physics-based model is too complex to create or takes too long to simulate.
%%
%[text] ## Make sure a project is open
try
    prj = currentProject;
catch
    open("VirtualSensorModeling.prj");
    prj = currentProject;
end
%%
%[text] ## Import data from Excel
%[text] Start by reading in the data with code generated by the Import Tool. Also remove data recorded when the aircraft was stationary on the ground as that will not be useful for predicting airspeed.
FlightData = importFlightData("FlightData.xlsx"); %[output:7894f2d1]
% perform simple clean up of stationary ground data
FlightData = FlightData(FlightData.TrueAirSpeed >= 10, :); %[control:slider:834f]{"position":[52,54]}
head(FlightData)
%%
%[text] ## Visualize data
%[text] We can see the flight path by viewing a `geoplot` of latitude and longitude.
figure
% Specify basemap that doesn't require internet download
geobasemap darkwater
% Create geoplot of FlightData.LatitudePosition and FlightData.LongitudePosition
h = geoplot(FlightData.LatitudePosition,FlightData.LongitudePosition,"LineWidth",2,"Color","red");
geobasemap streets

% Add title
title("LatitudePosition vs. LongitudePosition")
%[text] 
%[text] Some of the sensors appear to have dropouts that we'll need to clean.
figure %[task:9cde]
% Create plot of FlightData.Time and FlightData.OilPressure
plot(FlightData.Time,FlightData.OilPressure,"DisplayName","OilPressure");

hold on
% Create plot of FlightData.Time and FlightData.OilTemperature
plot(FlightData.Time,FlightData.OilTemperature,"DisplayName","OilTemperature");
hold off

legend %[task:9cde]
%%
%[text] ## Clean sensor data
%[text] Use the Data Cleaner to remove the sensor dropouts for oil pressure and temperature.
FlightDataClean = cleanOilSensors(FlightData);

figure %[task:0685] %[output:8f3527dc]
% Create plot of FlightDataClean.Time and FlightDataClean.OilPressure
plot(FlightDataClean.Time,FlightDataClean.OilPressure,"DisplayName","OilPressure"); %[output:8f3527dc]

hold on %[output:8f3527dc]
% Create plot of FlightDataClean.Time and FlightDataClean.OilTemperature
plot(FlightDataClean.Time,FlightDataClean.OilTemperature,"DisplayName","OilTemperature"); %[output:8f3527dc]
hold off %[output:8f3527dc]

legend %[task:0685] %[output:8f3527dc]

%%
%[text] ## Model True Air Speed
%[text] We can model TAS with a regression model trained in the Regression Learner app. We'll use a bagged decision tree with default settings, which produces very accurate cross-validated results. Normally in a machine learning workflow we'd use a separate hold-out test set to verify results, but we'll skip that here for brevity.
rng(42) % reproducibility
mdl = trainTASModel(FlightDataClean) %[output:13131b98]
PredictedAirSpeed = mdl.predictFcn(FlightDataClean);
%%
%[text] ## Model using a Python module
%[text] We can also use an existing Python module to train a similar model. We will then compare the results in the next section.
pyModel = py.pythonModeling.train_random_forest_regressor(FlightDataClean);
pyPredictedSpeeds = py.pythonModeling.predict_with_model(pyModel,FlightDataClean);
%%
plot(PredictedAirSpeed) %[output:13fce8ed]
hold on %[output:13fce8ed]
plot(pyPredictedSpeeds) %[output:13fce8ed]
plot(FlightDataClean.TrueAirSpeed) %[output:13fce8ed]
legend('MATLAB Model','Python Model','True Air Speed') %[output:13fce8ed]
hold off %[output:13fce8ed]

%[text] ## 
%%
%[text] ## Predictor importance
%[text] Which measurements are important for making predictions? One benefit of the bagged decision tree model is it automatically provides a measure of predictor importance. 
%[text] FuelFlow is the most important predictor in this case, followed by WindDirection, WindSpeed, and FanSpeed. 
figure %[output:758ae2df]
bar(mdl.RegressionEnsemble.predictorImportance) %[output:758ae2df]
xticklabels(mdl.RequiredVariables) %[output:758ae2df]

